import React, { Component } from 'react';

class ToggleMenu extends Component {

    constructor(props){
        super(props);
    }

    changeGrid (grid){
        this.props.changeGrid(grid);
    }

    render() {
        return (
            <div>

                            <p className="tab" onClick={this.changeGrid('drums')}>drums</p>
                            <p className="tab" onClick={this.changeGrid('synth')}>synth</p>
                            <p className="tab" onClick={this.changeGrid('bass')}>bass</p>

          </div>
        );
    }
}


export default ToggleMenu;
